import math

def square_root(Y):
    EPS = 1e-3
    a, b = 1, Y
    while (abs(a-b)>EPS):
        a = (a+b)//2
        b = Y//a
    return a

def main():
    N = int(input())

    for idx in range(N):
        _ = input()
        Y = int(input())
        if idx >= 1:
            print ("")

        print (square_root(Y))

if __name__ == '__main__':
    main()